import React from 'react';
import './style/index.css';
import Filter from './filter.js'

const Index = (props) => {
    return (
        <React.Fragment>

        <div class="grid-container">
            <div class="grid-item1">
                <h>Filter</h>
                <p>Launch Year</p>
                <div className="row">
                    <div>
                        <button>2006</button>
                        <button>2008</button>
                        <button>2010</button>
                        <button>2012</button>
                        <button>2014</button>
                        <button>2016</button>
                        <button>2018</button>
                        <button>2020</button>
                    </div>
                    <div>
                    <button>2007</button>
                        <button>2009</button>
                        <button>2011</button>
                        <button>2013</button>
                        <button>2015</button>
                        <button>2017</button>
                        <button>2019</button>
                    </div>
                </div>
                <p>Sucessful launch</p>
                <div className="row">
                    <div>True</div>
                    <div>false</div>
                </div>
                <p>Sucessful landing</p>
                <div className="row">
                    <div>True</div>
                    <div>false</div>
                </div>
            </div>
        {/* </div>


            <div class="grid-container"> */}
                {
                    props.spaces.map( spaceData => {
                        return  (

                            <div class="grid-item">
                                <img src={spaceData.links.mission_patch_small} alt="Mountains" />
                                <h4>{spaceData.mission_name}</h4>
                                <p>Mission Ids: {spaceData.mission_id}</p>
                                <p>Launch Year: {spaceData.launch_year}</p>
                                <p>sucessfull Launch: {spaceData.launch_success}</p>
                                <p>sucessfull Landing: {spaceData.rocket.first_stage.cores[0].land_success}</p>
                            </div>

                        )
                    })
                }
            </div>
        </React.Fragment>
    );
}
export const getStaticProps = async () => {
    const res = await fetch('https://api.spacexdata.com/v3/launches?limit=100')
    const spaces = await res.json()
    return {
        props: {
            spaces
        },
    }
  }

export default Index;
